import React from 'react';
import {Tabs,Tab,AppBar} from '@mui/material'


function TelaCadastro(){
  return(
<div>
<h1>React Material UI | Tabs</h1>

<AppBar>
  <Tabs>
    <Tab label="ITEM 1"/>
    <Tab label="ITEM 2"/>
    <Tab label="ITEM 3"/>
  </Tabs>
</AppBar>
</div>
    );

}

export default TelaCadastro;
